import React, {Fragment} from 'react'

export const BigCard = ({ejecutar}) => {
  return (
    <Fragment>
        <>
            <div>BigCard</div>
            <button onClick={ejecutar}>Ejeuctar</button>
        </>
    </Fragment>
  )
}

export default BigCard
